    data: |
      SELECT - + ( - 5 ) FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q603.out
    data: |
      5
      5
      5
      5
      5
      5
      5
      5
      5
